import React from "react";
import { Button, View, TouchableOpacity, Text } from "react-native";
import { Ionicons } from "@expo/vector-icons";

const LogOut = () => {
  return (

      <TouchableOpacity>
          <Ionicons
            name="ios-exit"
            size={24}
            color="black"
            onPress={() => console.log("object", "object")}
          />
        <Text>SignUp</Text>
      </TouchableOpacity>

  );
};

export default LogOut;
